class paddleObj{ height:number; width:number; x:number; color:string; y:number; vel_x:number; vel_y: number;
	constructor(height:number, width:number,	x:number, color:string, y:number, vel_x:number, vel_y:number)
	{
		this.height = height;
		this.width = width;
		this.x = x;
		this.color = color;
		this.y = y;
		this.vel_x = vel_x;
		this.vel_y = vel_y;
	}
}
export default paddleObj
